import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <div className="container-Nav">
      <ul>
        <Link to="/home">
          <li>Home</li>
        </Link>
        <Link to="/contact">
          <li>Contact</li>
        </Link>
        <Link to="/client">
          <li>Client</li>
        </Link>
        <Link to="/training">
          <li>Training</li>
        </Link>
        <Link to="/company">
          <li>Our Company</li>
        </Link>
      </ul>
    </div>
  );
}
export default Navbar;
